const data = {{table1.data}};
let bulkSubmit = {{table1.selectedRow.data.map(row => ({ID: row.ID}))}};
let changeSet = {{table1.changeSet}};

// 
Object.keys(changeSet).forEach(row_id => {
  const in_bulkSubmit = _.find(bulkSubmit, {ID: data.ID[row_id] })
  if (in_bulkSubmit) {
    Object.keys(changeSet[row_id]).forEach(column => {
      _.set(in_bulkSubmit, column, changeSet[row_id][column])
    })
  } else {
    bulkSubmit.push({ID: data.ID[row_id], ...changeSet[row_id]})
  }
})

let output = bulkSubmit.map(obj => {
    return {...obj, STATUS: 'Draft'};
});

return output;

